import React from 'react';
import Logo from '../../assests/group 3748.png'
import styles from "./Navbar.module.css"
import Button from '../Button/Button';

const Navbar = () => {
  return (
    <nav className={styles.navbar}>
      <Logo/>
      <Button/>
    </nav>
  );
}

export default Navbar;
